from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase

# Set up all devices.
prime_hub = PrimeHub()
right = Motor(Port.C, Direction.CLOCKWISE)
left = Motor(Port.A, Direction.COUNTERCLOCKWISE)
left_gear = Motor(Port.B, Direction.CLOCKWISE)
drive_base = DriveBase(left, right, 56, 80)

def Missioon_9__Pull():
    drive_base.straight(180)
    drive_base.turn(-85)
    drive_base.straight(590)
    drive_base.turn(140)
    drive_base.straight(150)
    left_gear.run_angle(1000, 650)
    drive_base.turn(-20)
    drive_base.straight(-200)
    left_gear.run_angle(1000, -650)
    drive_base.turn(-95)
    drive_base.straight(-500)

def Mission_10_Bucket_2():
    drive_base.straight(-180)
    drive_base.turn(20)
    left_gear.run_angle(1000, 700)
    left_gear.run_angle(1000, -700)

def Coming_Back_from_10_Bucket():
    drive_base.settings(straight_speed=700)
    drive_base.turn(-60)
    drive_base.straight(350)
    drive_base.turn(40)
    drive_base.straight(630)

def Miission_8_and_5():
    drive_base.straight(310)
    for count in range(3):
        left_gear.control.limits(acceleration=9000)
        left_gear.run_angle(8000, 580)
        left_gear.run_angle(8000, -580)
    drive_base.turn(-30)
    drive_base.straight(400)
    drive_base.turn(30)
    drive_base.straight(100)
    drive_base.turn(-28)
    drive_base.turn(30)
    drive_base.straight(-80)

def Mission_9_Push_black_lever():
    drive_base.turn(-60)
    drive_base.straight(250)
    drive_base.turn(-20)
    drive_base.straight(250)
    drive_base.turn(-140)

def mission_10_pull():
    drive_base.straight(180)
    drive_base.turn(-85)
    drive_base.straight(350)
    drive_base.turn(50)
    drive_base.straight(140)
    left_gear.run_angle(1000, 650)
    drive_base.arc(100, angle=-50)
    drive_base.straight(-400)
    left_gear.run_angle(1000, -650)

def Don_t_Use_This():
    # Start the code
    drive_base.straight(400)
    drive_base.straight(20)
    drive_base.turn(-30)
    drive_base.straight(950)
    drive_base.turn(-60)
    drive_base.straight(280)
    drive_base.turn(-135)
    drive_base.straight(350)
    drive_base.straight(-260)

def Mission_6___Forge():
    drive_base.straight(180)
    drive_base.turn(-85)
    drive_base.straight(185)
    drive_base.turn(85)
    drive_base.straight(450)
    drive_base.turn(40)
    drive_base.straight(80)
    drive_base.turn(-60)
    drive_base.turn(-85)
    drive_base.straight(180)


# The main program starts here.
drive_base.use_gyro(True)
drive_base.reset(0, 0)
left.reset_angle(0)
mission_10_pull()
